import React from "react";

const modelos = [
  { id: 1, nombre: "Cortina Blackout", precio: 50, imagen: "https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=400&q=80" },
  { id: 2, nombre: "Cortina Screen", precio: 60, imagen: "https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=400&q=80" },
  { id: 3, nombre: "Cortina Tradicional", precio: 40, imagen: "https://images.unsplash.com/photo-1502082553048-f009c37129b9?auto=format&fit=crop&w=400&q=80" },
];

const Catalog: React.FC = () => (
  <>
    <h2>Modelos Prefabricados</h2>
    <div className="catalog-grid">
      {modelos.map((m) => (
        <div key={m.id} className="catalog-card">
          <img src={m.imagen} alt={m.nombre} />
          <h3>{m.nombre}</h3>
          <p>Precio fijo: <b>â‚¬{m.precio}</b></p>
        </div>
      ))}
    </div>
  </>
);

export default Catalog;
